INSERT INTO `entornos` (`Id`, `Nombre`, `Descripcion`, `Tipo`, `Territorio`, `Latitud`, `Longitud`) VALUES
(1, 'embalse de maroño', '<p>el embalse de maro&ntilde o, enclavado en la localidad del mismo nombre, perteneciente al municipio de <a href=\"https://turismo.euskadi.eus/es/localidades/ayala-aiara/aa30-12375/es/\">ayala</a>, se encuentra protegido por la <strong>sierra s&aacute lvada</strong>, cordillera de escarpadas laderas y verticales roquedos que se eleva sobre este valle del norte de &aacute lava.</p><p>&nbsp </p><p>este bello paraje natural cuenta con amplios espacios abiertos rodeados de verdes praderas y un excelente embalse de aguas que abastece a localidades vecinas.</p><p>&nbsp </p><p>cada a&ntilde o, la presa acoge a numerosos amantes de la pesca. la especie m&aacute s abundante es el lucio, aunque tambi&eacute n se pueden capturar algunos ejemplares de trucha. la pesca en este embalse est&aacute  abierta desde marzo a septiembre. adem&aacute s, este paraje sirve de refugio para las <strong>aves migratorias</strong> que por condiciones meteorol&oacute gicas adversas no pueden sortear la sierra s&aacute lvada.</p><p>&nbsp </p><p>adem&aacute s, su espl&eacute ndido entorno boscoso, compuesto por pinares, robles y arbustos, nos permite disfrutar de una agradable jornada en <strong>uno de los entornos naturales m&aacute s hermosos de &aacute lava</strong>, que, a su vez, ofrece en las inmediaciones otras bellas estampas como el del ca&ntilde &oacute n de delika, lugar donde <a href=\"https://turismo.euskadi.eus/es/rutas/mirador-salto-nervion/aa30-12375/es/\">nace el r&iacute o nervi&oacute n</a> salvando m&aacute s de doscientos metros de desnivel.</p>', 'pantanos', 'araba/álava', 43.0468126377076, -3.05986404418945),
(2, 'embalse de ullíbarri-gamboa', '<p>emplazado en el municipio alav&eacute s de&nbsp <a href=\"https://turismo.euskadi.eus/es/localidades/arrazua-ubarrundia/aa30-12375/es/\">arrazua-ubarrundia</a>, el embalse de&nbsp <strong>ull&iacute barri-gamboa</strong>&nbsp adem&aacute s de abastecer de agua a vitoria-gasteiz y a los alrededores de bilbao, sirve como &aacute rea de esparcimiento, pues es uno de los lugares m&aacute s frecuentados por los alaveses en verano.</p><p>&nbsp </p><p>este espectacular paraje cuenta con dos estupendas playas reconocidas con la&nbsp <strong>bandera azul</strong>, por la calidad de su entorno y los servicios que ofrecen: <strong>landa</strong> y <strong>garaio</strong>.</p><p>&nbsp </p><p>tambi&eacute n hay un albergue situado en la&nbsp <strong>isla de zuaza</strong>&nbsp que posee excelentes instalaciones y servicios. el visitante tambi&eacute n encontrar&aacute  numerosas zonas de ba&ntilde o y &aacute reas de recreo que disponen de mesas, asadores, juegos infantiles... lugares todos ellos id&oacute neos para pasar un d&iacute a en familia y disfrutar de la naturaleza.</p><p>&nbsp </p><p>por otra parte, los amantes del deporte podr&aacute n realizar rutas por los alrededores del embalse, tanto a pie como en bicicleta. el pantano de&nbsp ull&iacute barri-gamboa&nbsp re&uacute ne, adem&aacute s, las mejores condiciones para la pr&aacute ctica de todo tipo de <strong>actividades y deportes acu&aacute ticos</strong> (remo, pirag&uuml ismo, windsurf...), ya que cuenta con dos clubes n&aacute uticos y embarcaderos.</p>', 'pantanos', 'araba/álava', 42.9260115266427, -2.56977081298828),
(3, 'embalse de urkulu', '<p>el embalse de urkulu se halla en el interior del territorio hist&oacute rico de gipuzkoa, a pocos kil&oacute metros de <a href=\"https://turismo.euskadi.eus/es/localidades/aretxabaleta/aa30-12375/es/\">aretxabaleta</a> y a los pies del monte kurtzebarri (1.146 m).</p><p>&nbsp </p><p>se trata de uno de los principales atractivos naturales del municipio, pues ofrece al visitante un entorno realmente apropiado para relajarse y <strong>disfrutar de la naturaleza</strong>. <br/> <br/>adem&aacute s, es un lugar propicio para practicar <strong>deporte al aire libre</strong>.&nbsp </p><p>&nbsp </p><p>una <strong>v&iacute a verde</strong> de 6,5 km rodea el pantano, y en &eacute l se han habilitado varios espacios para hacer gimnasia, con paneles explicativos que indican c&oacute mo realizar algunos ejercicios. en el embalse, tambi&eacute n se ofrece un servicio de alquiler de piraguas.</p><p>&nbsp </p><p><br/>son muchas las personas que acuden hasta aqu&iacute , sobre todo, durante los fines de semana. adem&aacute s, este enclave natural tambi&eacute n sirve de refugio a diversas especies de aves.</p><p>&nbsp </p><p>por otra parte, cabe destacar que el agua de este embalse es utilizada para abastecer a algunas localidades colindantes.</p>', 'pantanos', 'gipuzkoa', 43.019567, -2.476983),
(4, 'embalse de urrúnaga', '<p>el embalse de urr&uacute naga est&aacute  ubicado a caballo entre &aacute lava y bizkaia, rodeado de un espectacular paisaje, con el monte gorbeia (1.481 m) al fondo. pertenece en su mayor parte al municipio alav&eacute s de legutiano, aunque parte de la presa se encuentra en otxandio. <br/> <br/>este espl&eacute ndido enclave es uno de los principales atractivos tur&iacute sticos de legutiano, lo que ha favorecido el desarrollo de numerosas actividades relacionadas con el ocio, el deporte y el descanso. por un lado, en la orilla del embalse se han habilitado dos parques, el de sorgimendi y el de zabalain, que disponen de mesas, parrillas, fuentes, juegos infantiles... por otro, hacia el norte, se ubica el campo internacional de regatas, que tambi&eacute n funciona como escuela de regatas. <br/> <br/>el sector de la hosteler&iacute a se ha desarrollado en buen medida gracias al embalse. legutiano cuenta con numerosos bares y restaurantes, mientras que en otras localidades del municipio se pueden encontrar agroturismos (elosu), marisquer&iacute as (urr&uacute naga), etc. <br/> en la parte vizca&iacute na, es posible realizar una ruta que bordea parte del embalse. un poco antes del puente de gomilaz, parte un sendero que nos lleva hasta el barrio mekoleta, pasando por el monte san bernab&eacute , donde encontraremos un antiguo nevero rehabilitado en 1999. asimismo, el embalse de urr&uacute naga llama especialmente la atenci&oacute n por el gran n&uacute mero de aves y comunidades acu&aacute ticas que se concentran en este h&aacute bitat. por &uacute ltimo, destacar que numerosos pescadores acuden al embalse para capturar los mejores ejemplares.</p>', 'pantanos', 'bizkaia araba/álava araba/álava araba/álava', NULL, NULL),
(5, 'la arboleda', '<p>convertido hoy en d&iacute a en espacio de ocio y esparcimiento, <strong>la arboleda</strong> fue un pueblo minero donde se extra&iacute a el mineral de hierro. las antiguas minas son ahora embalses artificiales rodeados de un entorno verde, ideales para la pesca, aunque no est&aacute n recomendados para el ba&ntilde o.</p><p>&nbsp </p><p>el <a href=\"https://turismo.euskadi.eus/es/patrimonio-cultural/vivienda-minera-de-la-arboleda/aa30-12375/es/\">antiguo poblado minero</a> se extiende por los montes de triano. se sit&uacute a en la parte alta del municipio del valle de tr&aacute paga-trapagaran, a 7,5 km del centro urbano y se accede por un tortuoso camino. es preferible subir en el <a href=\"https://turismo.euskadi.eus/es/patrimonio-cultural/funicular-de-larreineta-la-arboleda/aa30-12375/es/\">funicular de larreineta</a>. este medio de transporte, que data de 1926, fue muy utilizado en la &eacute poca de la extracci&oacute n minera. hoy por hoy, el viaje en el funicular permite disfrutar de <strong>preciosas vistas</strong> sobre el abra de bilbao.</p><p>&nbsp </p><p>desde la reineta hay tan s&oacute lo un kil&oacute metro hasta la arboleda. este paraje cuenta con varias zonas recreativas, instalaciones deportivas (campo de f&uacute tbol, front&oacute n...), un albergue de la diputaci&oacute n de bizkaia y el centro de interpretaci&oacute n medio ambiental pe&ntilde as negras, donde ponen a disposici&oacute n del visitante una serie de itinerarios balizados para conocer y disfrutar tanto del entorno natural como de los restos de la explotaci&oacute n minera.</p><p>&nbsp </p><p>en el pueblo, hay numerosos restaurantes donde poder degustar la gastronom&iacute a de la zona. es muy t&iacute pico comer <strong>un buen plato de alubias</strong>.</p>', 'pantanos', 'bizkaia', 43.284928, -3.05386),
(6, 'piscinas fluviales de espejo', '<p>las piscinas fluviales de espejo se hallan en el territorio hist&oacute rico de &aacute lava, en el municipio de valdegov&iacute a, dentro de la cuadrilla de a&ntilde ana. <br/> <br/>este bello entorno, emplazado en el r&iacute o omecillo, se convierte en lugar de descanso para muchos lugare&ntilde os y visitantes durante los meses de verano. <br/> <br/>cuenta con amplios aparcamientos a ambos lados del r&iacute o, una zona de ba&ntilde o y un &aacute rea de recreo con arbolado que dispone de asadores, mesas, bancos e instalaciones infantiles para el disfrute de los m&aacute s peque&ntilde os. adem&aacute s, en el r&iacute o tambi&eacute n existen tramos preparados para los aficionados al pirag&uuml ismo.</p>', 'rios', 'araba/álava', 42.809638, -3.046388),
(7, 'piscinas fluviales de fresnedo', '<p>las <strong>piscinas fluviales de fresnedo</strong> se sit&uacute an en la entrada de la localidad alavesa de <a href=\"https://turismo.euskadi.eus/es/localidades/campezo-kanpezu/aa30-12375/es/\">santa cruz de campezo</a>, a un escaso kil&oacute metro del casco urbano y junto a la a-132, carretera que une vitoria-gasteiz y estella.</p><p>&nbsp </p><p>ese paraje se halla a orillas del r&iacute o izki, muy cerca del <a href=\"https://turismo.euskadi.eus/es/espacios-naturales/parque-natural-de-izki/aa30-12375/es/\" title=\"parque natural de izki\">parque natural</a> del mismo nombre. cuenta con un &aacute rea de esparcimiento dividido en dos zonas situadas a ambos lados del r&iacute o y conectadas mediante un puente de madera. este &aacute rea de recreo est&aacute  equipado con mesas, asadores, fuentes, una cancha de baloncesto y juegos infantiles, que permiten disfrutar de una jornada de lo m&aacute s agradable en contacto con la naturaleza.</p><p>&nbsp </p><p>durante los meses de verano, se instala un bar donde se sirven comidas. adem&aacute s, tambi&eacute n dispone de otros servicios como ba&ntilde os y duchas.</p>', 'rios', 'araba/álava', 42.6762516761553, -2.37030029296875),
(8, 'playa santiago de deba', '<p>la playa de santiago de deba se halla al oeste del litoral guipuzcoano, junto a la desembocadura del r&iacute o que lleva el nombre del municipio. con 400 metros de longitud, comprende tambi&eacute n la playa de lapari, ocupando una superficie total de 80.000 m&sup2 . <br/> <br/>de fina arena dorada, es una playa de fuerte oleaje, pues se encuentra abierta al mar. es ideal para dar largos paseos, bien por la orilla o bien por los tres paseos mar&iacute timos que la rodean. <br/> <br/>asimismo, todo aquel que decida acudir a esta hermosa playa podr&aacute  practicar actividades deportivas tales como surf, pirag&uuml ismo o windsurf. en la playa de deba se localiza una de las olas de mayor tama&ntilde o que podemos encontrar en la costa vasca, una derecha conocida como sorgin-zulo, de gran fuerza y que puede llegar a aguantar hasta los 5 metros. su fondo de roca y arena la hace a&uacute n si cabe m&aacute s peligrosa. en los d&iacute as que no hay tanto mar los picos se suceden a lo largo de la playa y m&aacute s cerca de la orilla, que en funci&oacute n de los fondos pueden dar buenas sesiones. cuenta con un club de surf local.</p>', 'playas', 'gipuzkoa', 43.2983184172804, -2.354269509262167),
(9, 'playa de alkolea', '<p>alkolea es una playa de rocas muy frecuentada por <strong>surfistas </strong>y por aficionados a la pesca submarina.</p><p>&nbsp </p><p>se trata de un arenal muy tranquilo, situado entre la punta de alkolea y la explanada de arbe, en una zona en la que puede disfrutarse de<strong> hermosas vistas de la costa guipuzcoana</strong>. esta playa de mutriku tiene una longitud de 920 metros.</p>', 'playas', 'gipuzkoa', 43.30762578068058, -2.3710132372955286),
(10, 'playa de antilla', '<p>la principal playa de orio se encuentra en un entorno excepcional, junto a la desembocadura del oria y al abrigo del monte kukuarri, que desciende <strong>de forma abrupta hacia el mar.</strong> <br/> <br/></p><p>&nbsp </p><p>reformada en 1997, esta playa tiene 3.500 m&sup2  de superficie, y cuenta en sus inmediaciones con un hermoso parque con juegos y columpios, un camping y un paseo mar&iacute timo, adem&aacute s de tres restaurantes que ofrecen una oferta gastron&oacute mica de lo m&aacute s variada. <br/> <br/>asimismo, es un lugar muy frecuentado por los aficionados a la pesca y otros deportes acu&aacute ticos como el <strong>surf, el pirag&uuml ismo o el windsurf</strong>.</p><p>&nbsp </p><p>cuenta con varias olas, destacando la izquierda de la playa junto al espig&oacute n, la cual empieza a romper los d&iacute as grandes. en la zona centro de la playa de <a href=\"https://turismo.euskadi.eus/es/localidades/orio/aa30-12375/es/\">orio</a> hay otros picos que rompen con mayor frecuencia, destacando la derecha sobre la izquierda. la playa cuenta con un club local. <br/></p>', 'playas', 'gipuzkoa', 43.288723, -2.127956),
(11, 'playa de aritxatxu', '<p>la playa de aritxatxu, situada en el municipio vizca&iacute no de bermeo, forma una <strong>peque&ntilde a y atractiva cala </strong>de arena dorada rodeada de grandes rocas. est&aacute  en un entorno apacible y es muy visitada por los amantes del submarinismo. <br/> <br/>cuenta con duchas, papeleras, aseos, vestuarios y bar, as&iacute  como con servicio de socorristas y hondartzainas. <br/> <br/> <br/></p>', 'playas', 'bizkaia', 43.428484, -2.737924),
(12, 'playa de armintza', '<p>peque&ntilde o <strong>barrio pesquero</strong> del municipio de lemoiz, un lugar con mucho encanto donde se suceden unas olas de lo m&aacute s curiosas. los d&iacute as de swell medio hay una derecha que rompe en una zona de acantilados y s&oacute lo en marea media. su acceso se debe hacer remando desde el peque&ntilde o puerto pesquero de la localidad. los d&iacute as de <em>swell</em> grande, hay una ola tipo <em>a-frame</em> a la entrada del canal del puerto algo complicada de coger y donde se necesita un apoyo mar&iacute timo. estos d&iacute as grandes en los que el mar est&aacute  desfasado, el puerto acoge una ola en el inicio del dique y rompe paralelo a &eacute l. se trata de una derecha blanda ideal para los m&aacute s peque&ntilde os. <br/> <br/>con 250 metros de longitud, est&aacute  formada por piedras y arena gruesa y oscura. como dato de inter&eacute s, cabe destacar que esta playa es muy frecuentada por los amantes del <strong>submarinismo y la pesca</strong>.</p>', 'playas', 'bizkaia', 43.43321809894, -2.898966690000634),
(13, 'playa de arrigorri', '<p>la playa de arrigorri est&aacute  situada en el municipio de ondarroa, en bizkaia. adem&aacute s de poder tomar el sol y disfrutar de un agradable ba&ntilde o, la playa de arrigorri ofrece la posibilidad de realizar numerosas actividades en sus 150 metros de arena fina. <br/> <br/>al estar situado en la zona urbana del municipio, dispone de numerosos bares y zonas de ocio, as&iacute  como de un excelente paseo mar&iacute timo, que nos lleva hasta la playa gipuzcoana de saturraran. <br/> <br/> <br/></p>', 'playas', 'bizkaia', 43.32285365608519, -2.4192082803955373),
(14, 'playa de arrigunaga', '<p>la playa de arrigunaga se encuentra en el municipio de getxo, en bizkaia. ubicada bajo los acantilados de la galea, ofrece hermosas vistas al abra y al molino de aixerrota. <br/> <br/>adem&aacute s de poder tomar el sol y un agradable ba&ntilde o, la playa de arrigunaga ofrece al visitante la posibilidad de realizar numerosas actividades como el <strong>surf </strong>o el skate. aunque es de f&aacute cil acceso, resulta algo peligrosa, ya que su fondo es de arena y roca, y al bajar la marea, aparecen puntas de roca, por lo que hay que tener cuidado. genera varias olas a lo largo de la playa, siendo las m&aacute s interesantes las que rompen atr&aacute s. <br/> en la zona oeste de la playa hay un espig&oacute n y junto a &eacute l, los d&iacute as de mucho mar rompe una derecha que se adentra en la r&iacute a. esta ola es s&oacute lo para expertos ya que rompe a partir de los dos metros de altura. a un kil&oacute metro m&aacute s hacia el norte se encuentra otra ola de gran calidad que solo rompe en ocasiones especiales, se trata de un <em>point break</em> que genera largas derechas. cabe destacar que este arenal ha obtenido la <strong>bandera azul</strong>, certificado internacional de calidad ambiental otorgado por la fee</p>', 'playas', 'bizkaia', 43.358253, -3.018707),
(15, 'playa de bakio', '<p>la hermosa playa de bakio, situada en el municipio vizca&iacute no del mismo nombre, cuenta con un largo paseo que recorre toda la playa, desde donde podemos divisar un <strong>extraordinario paisaje costero</strong>. <br/> <br/>adem&aacute s, al estar situado en pleno centro urbano, dispone de <strong>toda clase de servicios y lugares de ocio </strong>en sus inmediaciones. asimismo, ofrece al visitante la posibilidad de realizar actividades como el surf, el pirag&uuml ismo o voley playa. <br/> <br/>es una playa que ofrece olas de picos de derechas e izquierdas, con tres zonas diferenciadas, la zona oeste con una derecha potente que s&oacute lo rompe los d&iacute as grandes, el callej&oacute n y pe&ntilde as rojas, donde podemos encontrar <strong>olas de calidad </strong>gracias a sus fondos de arena y rocas. es id&oacute nea para surfistas de todos los niveles. ofrece olas pr&aacute cticamente todo el a&ntilde o al tratarse de una playa abierta. goza de un club local y dos escuelas de surf. aguanta hasta 2,5-3 metros y acoge importantes eventos de surf. <br/></p>', 'playas', 'bizkaia', 43.4302345617966, -2.80576229095459),
(16, 'playa de barinatxe', '<p>enclavada entre los municipios vizca&iacute nos de sopela y getxo, la playa de barinatxe est&aacute  compuesta por tres elementos vitales de la naturaleza: agua de una inmensa bravura, fina arena y un aire vol&aacute til que emana una pureza solamente propia de enclaves tan caracter&iacute sticos como este. precisamente gracias a su innato e impredecible ecosistema, barinatxe se ha ganado el nombre de &ldquo la salvaje&rdquo . <br/> <br/>se trata de una <strong>playa amplia y abierta, flanqueada por hermosos acantilados</strong>, y que cuenta con una zona naturista. <br/> <br/>asimismo, la playa de barinatxe ofrece la oportunidad de realizar numerosas actividades, entre las que destaca el <strong>surf</strong>, debido al gran oleaje de sus aguas. <br/> como su propio nombre indica se trata de una playa salvaje con un sistema dunar propio. cuenta con un edificio multiusos con vestuarios, duchas y donde tienen su sede las escuelas de surf locales, cuenta con dos clubes de surf y como el resto de las playas de esta zona hay una gran afluencia de ba&ntilde istas y surfistas. orientada al noroeste, la frecuencia de olas es bastante alta. es una playa que cuenta con distintos picos, la m&aacute s conocida es la ola de la triangular, de fondo rocoso, que puede aguantar bastante tama&ntilde o y funciona con todas las mareas. se trata de una derecha larga con un pico muy concentrado pero bastante noble, lo que la hace ideal para la pr&aacute ctica del longboard, en marea baja tiene una izquierda m&aacute s vertical con secciones tuberas. en la zona oeste de la playa est&aacute  la ola de la batidora, donde predominan las izquierdas. en la zona centro se encuentra la corriente, una izquierda muy t&eacute cnica y muy cambiante en funci&oacute n de la marea, el tama&ntilde o del swell y la corriente. en barinatxe los fondos son muy cambiantes y pueden dar olas de mucha calidad. sus acantilados son ideales para la pr&aacute ctica del parapente.</p>', 'playas', 'bizkaia bizkaia', NULL, NULL),
(17, 'playa de barrika', '<p>la playa de barrika, enclavada en el municipio del mismo nombre y a 25 km de bilbao, es una <strong>playa salvaje </strong>de 600 metros de longitud, <strong>rodeada de espectaculares acantilados</strong>. <br/> <br/>compuesto de arena y piedras, unas escaleras facilitan el acceso a este precioso arenal que se encuentra abierto al mar. debido a sus caracter&iacute sticas, es muy frecuentado por los surfistas, as&iacute  como por aficionados al nudismo. <br/> <br/>se trata de una playa escondida que desaparece con la marea, por lo que hay que estar muy atento. su fondo de arena y rocas produce olas de calidad media, destaca su izquierda larga y maniobrable. es imprescindible tener cuidado en la orilla. el entorno es verde y de una belleza singular. <br/></p>', 'playas', 'bizkaia', 43.40545839853304, -2.972990221309601),
(18, 'playa de ea', '<p>la <strong>playa de ea</strong> se halla en el municipio del mismo nombre, en la costa oriental de bizkaia. <br/> <br/>al estar <strong>ubicado en el mismo casco urbano</strong>, junto al <strong>pintoresco puerto</strong>, este peque&ntilde o y acogedor arenal cuenta en sus proximidades con varias zonas de paseo, as&iacute  como bares y restaurantes.</p><p>&nbsp </p><p>adem&aacute s de poder tomar el sol y disfrutar de un agradable ba&ntilde o, esta playa se encuentra bien equipada, con duchas, aseos p&uacute blicos, vestuarios, papeleras, guardabicicletas, fuentes y una zona de juegos infantiles. <br/> se trata de una playa vigilada, que cuenta con socorristas y plazas de aparcamiento en las inmediaciones.</p>', 'playas', 'bizkaia', 43.380135, -2.585593),
(19, 'playa de ereaga', '<p>la playa de ereaga se encuentra en el municipio de getxo, entre el puerto viejo de algorta y el espig&oacute n de arriluze. con sus m&aacute s de <strong>800 metros de fina arena</strong>, este hermoso arenal est&aacute  muy bien equipado de cara a la &eacute poca estival. <br/> <br/>por otro lado, son muchos los deportes que se practican en esta playa: surf, pirag&uuml ismo, voleibol y vela, entre otros. pero, sin duda, ereaga es muy conocida por los torneos de f&uacute tbol playa que aqu&iacute  se disputan. <br/> <br/>se trata de una playa urbana que ofrece sobre todo olas de izquierdas y es id&oacute nea para la pr&aacute ctica del bodyboard. olas cortas y tubulares. necesita mucho mar, por lo que no ofrece olas a menudo  aguanta olas de hasta 2 metros y cabe destacar que est&aacute  muy protegida del viento noroeste, por lo que resulta una alternativa muy v&aacute lida cuando las condiciones meteorol&oacute gicas son adversas en las playas abiertas y el mar est&aacute  desfasado. <br/> el otro spot existente en esta playa es el apodado jeffrey&#39 s por los locales: una derecha de calidad que rompe en la zona interna de la r&iacute a de bilbao, en frente del puerto viejo de algorta. necesita de mucha mar para empezar a romper y son pocas las veces que lo hace al a&ntilde o, pero cuando se dan las condiciones, aguanta olas largas de hasta 3 metros de altura. el acceso es complicado ya que hay que acceder entre rocas o realizar una remada de mucho recorrido. cabe destacar que este arenal ha obtenido la <strong>bandera azul</strong>, certificado internacional de calidad ambiental otorgado por la fee</p>', 'playas', 'bizkaia', 43.34189, -3.013635),
(20, 'playa de gaztetape', '<p>la playa de gaztetape se esconde al oeste del monte san ant&oacute n, m&aacute s conocido por el nombre de rat&oacute n de getaria por su peculiar forma. <br/> <br/>esta playa de <strong>fina arena dorada</strong> se encuentra abierta al mar y, por lo tanto, es muy frecuentada por los surfistas, quienes acuden a este arenal a disfrutar de las olas. aunque sobre todo destaca la ola derecha de la playa los d&iacute as grandes, la playa tambi&eacute n posee otras olas como la izquierda de las rocas y las orilleras de marea alta. su fondo es de arena y rocas y lastras que van avanzando en el mar. est&aacute  orientada al este y en funci&oacute n de los fondos puede dar excelentes sesiones. la playa cuenta con un club de surf local y es de gran belleza. <br/> <br/>tambi&eacute n se pueden practicar otros deportes, como windsurf, pirag&uuml ismo y pesca deportiva, entre otros.</p>', 'playas', 'gipuzkoa', 43.303655403374485, -2.206051341625198),
(21, 'playa de gorliz', '<p>sus <strong>extensas arenas y la seguridad de su ba&ntilde o</strong> hacen que esta playa sea preferida por las familias. <br/> <br/>la playa de gorliz, con 842 metros de longitud, est&aacute  ubicada en pleno centro urbano, rodeada de un hermoso paseo mar&iacute timo. cuenta en sus proximidades con zonas de ocio, un amplio aparcamiento a pie de playa y &aacute reas verdes con mesas, bancos, barbacoas y juegos infantiles. asimismo, dispone de <strong>todo tipo de servicios</strong>, como duchas, aseos, fuentes, lavapies, etc. <br/> <br/>adem&aacute s, en esta playa, se pueden practicar diversas actividades acu&aacute ticas:&nbsp surf, vela, pirag&uuml ismo y voleibol, entre otras. <br/> primera playa de euskadi certificada con la q de calidad tur&iacute stica. dispone de wifi gratuito.</p>', 'playas', 'bizkaia', 43.4183904607326, -2.94570922851563),
(22, 'playa de gorrondatxe (azkorri)', '<p><strong>gorrondatxe</strong> es la cuarta playa de <a href=\"https://turismo.euskadi.eus/es/localidades/getxo/aa30-12375/es/\">getxo</a>&nbsp y&nbsp quiz&aacute  la menos accesible, pero la m&aacute s limpia. conocido tambi&eacute n por el nombre de <strong>azkorri</strong>, este arenal se encuentra alejado del casco urbano del municipio al que pertenece, pero pr&oacute ximo a la vecina localidad de berango.</p><p>&nbsp </p><p>la playa est&aacute  situada en un <strong>entorno natural de excepci&oacute n</strong>, rodeada de abruptos acantilados y hermosas dunas. de arena fina y oscura, est&aacute  bien equipada.</p><p>&nbsp </p><p>asimismo, la playa de gorrondatxe es un lugar propicio para la pr&aacute ctica de algunas actividades deportivas, como el voleibol y el surf.</p><p>&nbsp </p><p>se trata de una de las playas m&aacute s especiales de la zona, es de las pocas que a&uacute n conserva el sistema dunar propio y es un&nbsp <em>beach rock</em>, su superficie es dura. en la zona oeste de la playa se encuentra la ola del akanti, justo enfrente de la punta del acantilado, es una izquierda muy t&eacute cnica con distintas secciones, alguna de ellas tubera. puede aguantar hasta 3 metros y necesita un swell medio para empezar a funcionar. en la zona centro y este de la playa tambi&eacute n hay olas interesantes que rompen sobre roca, una derecha intensa y una izquierda de mayor calidad. en ambas olas es importante que las condiciones de viento y swell sean lo m&aacute s limpias posible.</p><p>&nbsp </p><p>cabe destacar que este arenal ha obtenido la bandera azul, certificado internacional de calidad ambiental otorgado por la fee.</p>', 'playas', 'bizkaia', 43.3791013350026, -3.02021026611328),
(23, 'playa de hondarribia', '<p>la playa de <a href=\"https://turismo.euskadi.eus/es/localidades/hondarribia/aa30-12375/es/\">hondarribia</a> est&aacute  ubicada en el extremo oriental del litoral guipuzcoano, concretamente en la hermosa <a href=\"https://turismo.euskadi.eus/es/espacios-naturales/bahia-de-txingudi-y-hondarribia/aa30-12375/es/\">bah&iacute a de txingudi</a>, junto a la desembocadura del r&iacute o bidasoa.</p><p>&nbsp </p><p>este hermoso arenal de <strong>fina arena dorada</strong> y aguas tranquilas cuenta con 700 metros de longitud. se encuentra muy cerca del centro urbano, por lo que est&aacute  rodeado de numerosos establecimientos hosteleros y dispone de diversos servicios.</p><p>&nbsp </p><p>hondarribia es un spot alternativo para los d&iacute as de maret&oacute n. se trata de una derecha larga y maniobrable que rompe junto al espig&oacute n y da buenas sesiones, sobre todo en invierno. &uacute nico spot del municipio, es uno de los m&aacute s bellos de la costa vasca.</p><p>&nbsp </p><p>asimismo, en esta playa, podemos practicar otros deportes acu&aacute ticos, entre los que destacan el pirag&uuml ismo y el windsurf. adem&aacute s, durante la &eacute poca estival, se coloca una estructura en el mar con toboganes y trampolines.</p>', 'playas', 'gipuzkoa', 43.3797889, -1.7945024000000558),
(24, 'playa de hondartzape', '<p>la playa de hondartzape est&aacute  ubicada en el municipio vizca&iacute no de mundaka, a 36 km de bilbao. la principal caracter&iacute stica de esta playa son sus rocas y su arena negra, formando as&iacute , en bajamar, una <strong>peque&ntilde a y bonita cala</strong>. <br/> <br/>la playa cuenta en sus inmediaciones con unas <strong>espectaculares vistas</strong>, dado que se encuentra dentro de la reserva de la biosfera de urdaibai, espacio natural de gran inter&eacute s por ser lugar de reposo e invernada de muchas especies de aves migratorias. <br/> <br/>hondartzape es un lugar apropiado para quienes buscan un <strong>ambiente tranquilo e ideal</strong> para los amantes del <strong>submarinismo</strong>.</p>', 'playas', 'bizkaia', 43.407335, -2.698322),
(25, 'playa de isuntza', '<p>la playa de isuntza se encuentra en el municipio de <a href=\"https://turismo.euskadi.eus/es/localidades/lekeitio/aa30-12375/es/\" target=\"_blank\">lekeitio</a>, al este del litoral vizca&iacute no. al estar ubicada en el mismo <strong>casco urbano</strong>, junto al puerto y el parque de la localidad, isuntza tiene numerosas zonas de paseo, bares, restaurantes y hoteles en sus alrededores. <br/> <br/></p><p>&nbsp </p><p>adem&aacute s, la playa de lekeitio cuenta con socorristas, hondartzainas y aparcamiento urbano. tambi&eacute n dispone de aseos p&uacute blicos, lavabos, duchas, vestuarios, guardabicicletas y lavapies. ofrece, asimismo, la posibilidad de realizar algunas actividades deportivas, tales como pirag&uuml ismo, voleibol y submarinismo.</p><p>&nbsp </p><p><br/><br/>desde la playa, se pueden observar excelentes panor&aacute micas de la <strong>isla de san nicol&aacute s</strong>, a la cual podremos acceder por el malec&oacute n en bajamar. <br/></p>', 'playas', 'bizkaia', 43.3632537512373, -2.50110626220703),
(26, 'playa de itzurun', '<p>la <strong>playa de itzurun</strong>, en <a href=\"https://turismo.euskadi.eus/es/localidades/zumaia/aa30-12375/es/\">zumaia</a>, forma parte de uno de los tramos m&aacute s espectaculares del litoral guipuzcoano. sus enormes acantilados verticales, paredes de piedra caliza que alcanzan hasta 150 metros de ca&iacute da, llamar&aacute n especialmente la atenci&oacute n del visitante. se trata de un fen&oacute meno geol&oacute gico denominado&nbsp <a href=\"https://turismo.euskadi.eus/es/espacios-naturales/la-rasa-mareal-y-los-acantilados-del-flysch/aa30-12375/es/\"><em>flysch</em></a>&nbsp formado durante miles de a&ntilde os por la erosi&oacute n del mar.</p><p>&nbsp </p><p>encajada entre estos <strong>bellos acantilados</strong>, la playa de itzurun, de fina arena dorada, se encuentra muy cerca del casco urbano de zumaia. cuenta con 270 metros de longitud y fuerte oleaje, por lo que es un lugar propicio para practicar diversos deportes acu&aacute ticos, como el surf, el pirag&uuml ismo o el bodyboard. posee olas derechas e izquierdas que var&iacute an en funci&oacute n de las mareas, la zona oeste de la playa de san telmo requiere de un nivel m&aacute s avanzado por tener fondos de arena y roca. aqu&iacute , en marea alta, existe una orillera que crea rebotes contra el acantilado formando excelentes rampas para los bodyboarders.</p><p>&nbsp </p><p>a pie de playa hay un bar donde ofrecen comidas en &eacute poca estival y, a escasos metros, un centro de talasoterapia con impresionantes vistas.</p>', 'playas', 'gipuzkoa', 43.30055372541465, -2.2604322519287052),
(27, 'playa de kanala', '<p>la playa de kanala est&aacute  ubicada en el municipio vizca&iacute no de gautegiz-arteaga, en la margen derecha de la r&iacute a de gernika. <br/> <br/>esta<strong> tranquila y acogedora</strong> playa, compuesta de una fina arena dorada, guijarros y piedras, ofrece al visitante la posibilidad de relajarse tomando el sol o disfrutando de un agradable ba&ntilde o. tambi&eacute n es un lugar propicio para practicar diversos deportes acu&aacute ticos, como <strong>windsurf, vela y pirag&uuml ismo</strong>. <br/> <br/>gracias a su privilegiado enclave, contemplaremos las impresionantes vistas que nos ofrece la reserva de la biosfera de urdaibai, espacio natural de excepci&oacute n formado por 12 km de extensos arenales y que constituye la zona h&uacute meda m&aacute s importante de euskadi. <br/></p>', 'playas', 'bizkaia', 43.3845908706076, -2.68117904663086),
(28, 'playa de kanalape', '<p>la playa de kanalape es uno de los arenales que se forman en la r&iacute a de gernika. est&aacute  ubicada en el municipio vizca&iacute no de gautegiz arteaga, desde donde accederemos tras descender a pie un sendero que parte detr&aacute s de la iglesia del barrio de kanala. <br/> <br/></p><p>&nbsp </p><p>playa <strong>acogedora y de aguas tranquilas</strong>, sus 300 metros de arena fina y dorada invitan a relajarse, al tiempo que nos ofrecen unas hermosas vistas de la <a href=\"https://turismo.euskadi.eus/es/top10/espacios-naturales/reserva-de-la-biosfera-de-urdaibai/aa30-12376/es/\" target=\"_blank\">reserva de la biosfera de urdaibai</a>, uno de los humedales m&aacute s importantes de euskadi que sirve de cobijo a numerosas especies de aves migratorias.</p><p>&nbsp </p><p><br/><br/>en este privilegiado entorno tambi&eacute n es posible practicar alguna actividad acu&aacute tica, como <strong>la vela y el windsurf</strong>.</p>', 'playas', 'bizkaia', 43.381846164937, -2.67851829528809),
(29, 'playa de karraspio', '<p>la hermosa playa de karraspio pertenece al municipio de mendexa, aunque pr&aacute cticamente se encuentra en lekeitio. <br/> <br/>el arenal ofrece al visitante la posibilidad de realizar numerosas actividades deportivas como <strong>surf, voleibol y vela</strong>. karraspio es apropiada para la iniciaci&oacute n al surf. necesita un swell grande para romper. posee distintas olas que var&iacute an en funci&oacute n de la marea. la isla de san nicol&aacute s est&aacute  justo enfrente y las series pasan por su costado este, donde en ocasiones sale una izquierda de calidad. <br/> <br/>asimismo, al lado de la carretera que nos lleva desde lekeitio a karraspio, hay un paseo, desde el cual contemplaremos las preciosas vistas que nos ofrece la costa vizca&iacute na.</p>', 'playas', 'bizkaia', 43.3628169481706, -2.49423980712891),
(30, 'playa de la arena', '<p>situada entre muskiz y zierbena, la hermosa playa de la arena tiene 966 metros de longitud y es<strong> uno de los rincones preferidos de los surfistas</strong> de la margen izquierda del gran bilbao. <br/> <br/>es la &uacute ltima playa de euskadi en su l&iacute mite oeste. tiene fundamentalmente tres olas principales: la izquierda de pobe&ntilde a, en la zona oeste de la playa, el centro y la derecha del vivero, en la zona este de la playa. es en el centro donde se imparten las clases de surf, ya que los otros dos picos merecen especial atenci&oacute n por las fuertes corrientes. todas las olas funcionan en todas las mareas, aunque pobe&ntilde a rompe mejor con marea baja, siendo una izquierda larga de gran calidad que puede ofrecer sesiones &eacute picas. la playa aguanta hasta los 2 metros y no necesita mucho mar, gracias a que es un arenal abierto.</p>', 'playas', 'bizkaia bizkaia', NULL, NULL),
(31, 'playa de la concha', '<p>la incomparable <strong>playa de la concha</strong> es una de las se&ntilde as de identidad de <a href=\"https://turismo.euskadi.eus/es/top10/localidades/donostia-san-sebastian/aa30-12375/es/\">san sebasti&aacute n</a>. situada en pleno centro de la ciudad, ofrece al visitante la oportunidad de disfrutar de magn&iacute ficas vistas, como la que nos ofrece su hermosa bah&iacute a en forma de concha, con la isla de santa clara en el centro, flanqueada por los montes urgull e igeldo.</p><p>&nbsp </p><p>de <strong>fina arena dorada</strong>, en sus 1.350 metros de longitud podemos practicar numerosas actividades deportivas, tales como surf, windsurf, pirag&uuml ismo, bodyboard, voleibol o f&uacute tbol playa. es un spot alternativo para los d&iacute as grandes, un&nbsp <em>beach break</em>&nbsp muy urbano. cuenta con varios picos, sobre todo derechas, destacando el pico del loro en marea alta, ideal para la pr&aacute ctica de bodyboard.</p><p>&nbsp </p><p>en la temporada de verano, se coloca una estructura en el mar con toboganes y trampolines, que nos permite disfrutar a&uacute n m&aacute s del ba&ntilde o.&nbsp <br/></p>', 'playas', 'gipuzkoa', 43.3181840687112, -1.98646545410156),
(32, 'playa de laga', '<p>la hermosa playa dunar de laga, enclavada en la <a href=\"https://turismo.euskadi.eus/es/top10/espacios-naturales/reserva-de-la-biosfera-de-urdaibai/aa30-12376/es/\" target=\"_blank\">reserva de la biosfera de urdaibai</a> y junto al cabo de ogo&ntilde o (279 m), pertenece al municipio de ibarrangelu.</p><p>&nbsp </p><p>es uno de los arenales m&aacute s bonitos de la costa vizca&iacute na. con sus <strong>574 metros de arena fina y dorada</strong>, la playa se encuentra <strong>abierta al mar</strong>.</p><p>&nbsp </p><p>n&uacute cleo surfero de los <strong>surfistas </strong>de gernika y alrededores, las olas de laga son cortas e intensas, picos de izquierda y de derechas. la zona este de la playa es la m&aacute s concurrida.</p><p>&nbsp </p><p>necesita un swell medio de direcci&oacute n oeste para empezar a funcionar. puede aguantar hasta los dos metros. cuenta con un club de surf y una escuela. <br/> tambi&eacute n se practican otros deportes acu&aacute ticos, como la vela o el pirag&uuml ismo. los m&aacute s intr&eacute pidos incluso se atreven a saltar desde el pe&ntilde &oacute n de ogo&ntilde o con sus parapentes.</p>', 'playas', 'bizkaia', 43.4090382177706, -2.65663146972656),
(33, 'playa de laida', '<p>la playa de laida pertenece al municipio vizca&iacute no de ibarrangelu y est&aacute  ubicada en la <a href=\"https://turismo.euskadi.eus/es/top10/espacios-naturales/reserva-de-la-biosfera-de-urdaibai/aa30-12376/es/\" target=\"_blank\">reserva de la biosfera de urdaibai</a>. <br/> <br/>con casi un kil&oacute metro de arena fina y dorada, es la playa m&aacute s grande de la r&iacute a de mundaka, y ofrece la posibilidad de realizar multitud de actividades deportivas: windsurf, pirag&uuml ismo, vela...</p><p>&nbsp </p><p>pero, sin duda, la <strong>pr&aacute ctica del surf </strong>merece especial menci&oacute n. alberga olas de calidad, largas y blandas, ideales para el longboard. tambi&eacute n destacan sus corrientes. en esta zona operan las escuelas de surf de mundaka.</p><p>&nbsp </p><p><br/><br/>otra de las caracter&iacute sticas que distingue a esta playa vizca&iacute na es la poca profundidad de sus aguas, ideal para el ba&ntilde o infantil. adem&aacute s, en la mitad del arenal, se forma una hermosa duna, desde donde divisaremos una excelente vista de la desembocadura de la r&iacute a, con la <strong>isla de izaro</strong> al fondo.</p>', 'playas', 'bizkaia', 43.39957539567573, -2.6856207847595215),
(34, 'playa de laidatxu', '<p>la playa de laidatxu se halla en el municipio vizca&iacute no de <a href=\"https://turismo.euskadi.eus/es/localidades/mundaka/aa30-12375/es/\" target=\"_blank\">mundaka</a>, muy cerca del <strong>casco urbano</strong>. <br/> <br/>de dimensiones peque&ntilde as y <strong>arena fina y dorada</strong>, la calidad de sus aguas es muy buena, por lo que es muy recomendable para familias con ni&ntilde os. <br/> <br/></p><p>&nbsp </p><p>considerada como u<strong>na de las 10 mejores olas del mundo</strong>, mundaka ofrece olas izquierdas de gran nivel, aptas s&oacute lo para surfistas con conocimientos altos. necesita condiciones muy especiales. su ola, espectacularmente tubular, se caracteriza adem&aacute s por su gran longitud. puede aguantar hasta los 4 metros.</p><p>&nbsp </p><p>su situaci&oacute n en la salida de la r&iacute a de gernika, hace que sus fondos no sean constantes y que cambien a lo largo del a&ntilde o. enclavada en la <a href=\"https://turismo.euskadi.eus/es/top10/espacios-naturales/reserva-de-la-biosfera-de-urdaibai/aa30-12376/es/\" target=\"_blank\">reserva de la biosfera urdaibai</a>, declarada patrimonio de la humanidad por la unesco, es uno de los parajes m&aacute s espectaculares de la costa vasca.</p><p>&nbsp </p><p>la playa de mundaka alberga importantes eventos de nivel mundial. este peque&ntilde o arenal ofrece tambi&eacute n la posibilidad de realizar otras actividades, como pirag&uuml ismo, windsurf... <br/> en la temporada de verano, podemos tomar un ferry para trasladarnos hasta la cercana playa de laida, y recorrer as&iacute  parte de la hermosa reserva de la biosfera de urdaibai.</p>', 'playas', 'bizkaia', 43.4049851306295, -2.69937515258789),
(35, 'playa de landa', '<p>situada en el embalse de ullibarri-gamboa tiene 40 ha y 500 metros de playa. el pantano al que se asoma es el que suministra de agua potable a vitoria-gasteiz y parte de bilbao. <br/> <br/>durante el periodo estival disponen de zonas de sol&aacute rium, &aacute reas acotadas para el ba&ntilde o infantil, duchas y puestos del servicio de socorrismo y primeros auxilios. <br/> <br/>el parque provincial de landa se encuentra al noroeste del embalse. existen itinerarios que recorren a pie o en bici la pr&aacute ctica totalidad del embalse. una visita obligada es el cercano parque ornitol&oacute gico mendixur. <br/> esta playa interior ha sido reconocida con la bandera azul, por la calidad de su entorno y los servicios que ofrece.</p>', 'playas', 'araba/álava', 42.9400128416397, -2.6054306386230337),
(36, 'playa de las arenas', '<p>la playa de las arenas se encuentra en el municipio vizca&iacute no de <a href=\"https://turismo.euskadi.eus/es/localidades/getxo/aa30-12375/es/\" target=\"_blank\">getxo</a>, en el abra de bilbao, junto al muelle de churruca y muy pr&oacute xima al <a href=\"https://turismo.euskadi.eus/es/top10/patrimonio-cultural/puente-colgante-de-bizkaia/aa30-12376/es/\" target=\"_blank\">puente de bizkaia</a>, monumento declarado patrimonio de la humanidad. <br/> <br/></p><p>&nbsp </p><p>este peque&ntilde o arenal, ubicado en pleno centro urbano, est&aacute  bien comunicado y cuenta en sus inmediaciones con un club mar&iacute timo de gran tradici&oacute n y numerosos servicios hosteleros.</p><p>&nbsp </p><p><br/><br/>en la &eacute poca estival, socorristas y hondartzainas vigilan la playa, mientras que los usuarios tienen a su disposici&oacute n varios servicios  aseos, duchas, vestuarios, fuentes... <br/> adem&aacute s de ser un lugar propicio para tomar el sol, esta playa ofrece la posibilidad de realizar diversas actividades, como windsurf, piraguismo y, en especial, <strong>vela.</strong></p><p>&nbsp </p><p>cerca se encuentra la escuela de vela jos&eacute  luis de ugarte, donde se organizan cursos de iniciaci&oacute n y perfeccionamiento en este deporte a partir de los ocho a&ntilde os, entre otras actividades.</p>', 'playas', 'bizkaia', 43.3264264544351, -3.0177640914917),
(37, 'playa de malkorbe', '<p>la playa de malkorbe es uno de los dos arenales que tiene getaria. est&aacute  situada cerca del casco urbano, justo al lado del puerto deportivo que permite el atraque de yates y veleros. <br/> <br/>con vistas sobre el monte san ant&oacute n, m&aacute s conocido como el rat&oacute n de getaria por su peculiar forma, esta <strong>coqueta y tranquila playa</strong> de 420 metros de longitud no presenta mucho oleaje. <br/> <br/>dispone de diversos servicios, como fuentes, aseos p&uacute blicos, duchas, accesos a personas discapacitadas, juegos infantiles, etc. adem&aacute s, es una playa vigilada, rodeada de <strong>servicios hosteleros</strong>, ideal para pasar una agradable jornada entre amigos o en familia. <br/> asimismo, cuenta con una zona deportiva donde poder practicar varias actividades como voleibol, pirag&uuml ismo, submarinismo y windsurf.</p>', 'playas', 'gipuzkoa', 43.301297, -2.2021),
(38, 'playa de meñakoz', '<p>ideal para quienes busquen espacios solitarios y tranquilos, la playa salvaje de me&ntilde akoz pertenece a barrika, aunque se encuentra algo alejada del centro urbano, cerca de la carretera que se dirige hacia sopelana. <br/> <br/>en sus 400 metros de longitud, esta playa nudista cuenta con poca arena y abundante piedra. est&aacute  abierta al mar, por lo que es muy frecuentada por los amantes del <strong>surf</strong>, que acuden a esta playa con su tabla a coger olas. <br/> <br/>acoge una ola grande de fama mundial, s&oacute lo para expertos. se trata de una derecha que aguanta gran tama&ntilde o, 5-6 metros surfeables, con mucha fuerza y secciones tuberas. rompe enfrente de un acantilado y las rocas acent&uacute an su peligrosidad. <br/> adem&aacute s, este tramo de la costa vizca&iacute na nos brinda la posibilidad de realizar agradables paseos por sus <strong>espectaculares acantilados</strong>, cubiertos de un manto verde, que llaman la atenci&oacute n por su belleza.</p>', 'playas', 'bizkaia', 43.3951630640074, -2.98562049865723),
(39, 'playa de muriola', '<p>tambi&eacute n conocida como la cantera, est&aacute  playa nudista est&aacute  ubicada a 10 minutos del casco urbano de barrika, en una peque&ntilde a ensenada orientada hacia el este y protegida por <strong>acantilados de gran belleza</strong>. <br/> <br/>este arenal salvaje, de reducidas dimensiones, est&aacute  compuesto de arena y rocas y carece de servicios. se accede por un camino desde el aparcamiento situado cerca la rotonda que se encuentra a la entrada de la localidad. <br/> <br/>muriola es, sin duda, un lugar apropiado para quienes busquen un <strong>ambiente tranquilo</strong> e ideal para aquellos que deseen practicar submarinismo.</p>', 'playas', 'bizkaia', 43.4130286847514, -2.95995712280273),
(40, 'playa de ogeia', '<p>la playa de ogeia se halla en el municipio de ispaster, en la costa oriental de bizkaia. esta apacible y tranquila playa salvaje, compuesta de piedras y arena, llama la atenci&oacute n por un peculiar fen&oacute meno geol&oacute gico denominado<strong> <em>flysch</em></strong>, rocas calizas y areniscas en l&aacute minas que se alternan con otros materiales como la arcilla. <br/> <br/>de dimensiones peque&ntilde as, la extensi&oacute n de esta playa var&iacute a mucho entre la bajamar y la pleamar. <br/> <br/>por otro lado, en sus aguas, es muy habitual ver a <strong>surfistas </strong>sobre sus tablas desafiando a las olas. ogeia es un excelente point break de olas izquierdas y derechas. la derecha presenta secciones r&aacute pidas y tubulares finalizando en las rocas. la izquierda es m&aacute s larga y maniobrable. hay que tener cuidado en la entrada y en la salida debido a las hileras de roca. puede aguantar hasta 2 metros y necesita de un swell grande para empezar a romper. <br/> la playa tambi&eacute n es muy frecuentada por los amantes del <strong>submarinismo</strong>.</p>', 'playas', 'bizkaia', 43.3732369638364, -2.54573822021484),
(41, 'playa de ondarbeltz', '<p>tal y como indica su nombre en euskera, esta playa de aguas tranquilas est&aacute  compuesta de una arena fina y oscura. a pesar de pertenecer al t&eacute rmino municipal de mutriku, ondarbeltz se sit&uacute a m&aacute s cerca del casco urbano de deba, en la margen izquierda de la desembocadura de la r&iacute a que da nombre a la localidad costera.</p><p>&nbsp </p><p><br/><br/>esta playa de mutriku, de 120 metros de longitud, tiene unas instalaciones completas, con duchas y aseos p&uacute blicos. tambi&eacute n hay un bar, un &aacute rea de juegos infantiles, front&oacute n y aparcamiento. <br/> <br/>adem&aacute s de disfrutar del sol y del mar, se pueden practicar varias actividades deportivas, como windsurf y pirag&uuml ismo. <br/></p>', 'playas', 'gipuzkoa', 43.301412, -2.357451),
(42, 'playa de ondarreta', '<p>situada en el extremo oeste de la capital donostiarra, al abrigo del monte igeldo y frente a la isla de santa clara, esta playa de fina arena dorada es una de las m&aacute s elegantes de gipuzkoa. <br/> <br/>ondarreta, con sus 600 metros de longitud, dispone de una variada oferta deportiva. durante los meses de verano, se organizan cursos de nataci&oacute n y voleibol. asimismo, es posible practicar numerosas actividades acu&aacute ticas y posee, adem&aacute s, amplias y modernas instalaciones. <br/> <br/>ondarreta cuenta con un par de izquierdas que rompen junto al paseo oeste de la playa. izquierdas r&aacute pidas e intensas. es un spot alternativo para los d&iacute as de maret&oacute n y condiciones adversas, est&aacute  protegida de los vientos del oeste. de gran vistosidad ya que los paseantes est&aacute n literalmente encima de los surfistas. <br/> precisamente, est&aacute  unida a las playas de la concha y la zurriola a trav&eacute s de un paseo mar&iacute timo de 7 kil&oacute metros que termina cerca de ondarreta, en el peine del viento, espacio m&aacute gico donde contemplaremos las esculturas de acero de eduardo chillida que se agarran a las rocas, desafiando a las olas del mar.</p>', 'playas', 'gipuzkoa', 43.317184915667, -2.00277328491211);
INSERT INTO `entornos` (`Id`, `Nombre`, `Descripcion`, `Tipo`, `Territorio`, `Latitud`, `Longitud`) VALUES
(43, 'playa de plentzia', '<p>contigua a la playa de gorliz, es uno de los arenales m&aacute s frecuentados de la costa vizca&iacute na. la playa se encuentra en una preciosa bah&iacute a, junto a la desembocadura de la r&iacute a y muy cerca del casco urbano. <br/> <br/>un paseo mar&iacute timo rodea este arenal de fina arena dorada. de aguas tranquilas, es ideal para familias con ni&ntilde os y para aquellos que desean practicar deportes acu&aacute ticos como windsurf, surf o pirag&uuml ismo. <br/> <br/>su ola es una de las mejores alternativas cuando las condiciones son adversas y el mar est&aacute  desfasado. se trata de una ola ideal para la iniciaci&oacute n y el desarrollo del surf de los m&aacute s peque&ntilde os. es una izquierda larga y maniobrable que se deja surfear. la playa cuenta con dos escuelas que operan todo el a&ntilde o.</p>', 'playas', 'bizkaia', 43.4112828877988, -2.94708251953125),
(44, 'playa de san antonio', '<p>la playa de san antonio se encuentra entre las localidades de busturia y sukarrieta, en la margen izquierda de la r&iacute a de mundaka. <br/> <br/>protegida por la isla sandindere, esta playa ofrece en sus casi 200 metros de arena dorada la posibilidad de practicar actividades como voleibol, windsurf, vela... <br/> <br/>san antonio est&aacute  bien equipada, con aseos, duchas, lavapies, guardabiciletas, etc. adem&aacute s, es un lugar tranquilo, muy recomendable para familias con ni&ntilde os, pues cuenta con una hermosa &aacute rea recreativa junto a la playa, dotada de instalaciones infantiles, mesas, bancos, etc. <br/></p>', 'playas', 'bizkaia bizkaia', NULL, NULL),
(45, 'playa de santiago', '<p>la playa de santiago est&aacute  situada en las afueras de zumaia, entre las marismas de la desembocadura del r&iacute o urola y la carretera n-634 que lleva a getaria. <br/> <br/>este extenso arenal, de 350 metros de longitud y 175 metros de ancho, dispone de una zona verde con un &aacute rea de juegos infantiles y bar, ideal para pasar una agradable jornada en familia o entre amigos. <br/> <br/>cuenta con instalaciones como duchas y aseos p&uacute blicos, adem&aacute s de un servicio de asistencia e informaci&oacute n y zonas para aparcar junto a la carretera. <br/> la playa de santiago, de aguas tranquilas, presenta en ocasiones algo de oleaje. el visitante tendr&aacute  la oportunidad de practicar numerosas actividades acu&aacute ticas como windsurf y pirag&uuml ismo. asimismo, existe la opci&oacute n de alquilar pedalos y dar un agradable paseo en el mar.</p>', 'playas', 'gipuzkoa', 43.30194579605323, -2.2511672973632812),
(46, 'playa de saturraran', '<p>emplazado en el extremo occidental del litoral guipuzcoano, lindando con bizkaia, la playa de saturraran forma parte de un bello entorno. las olas llegan con fuerza hasta este arenal que destaca por el peculiar perfil de dos pe&ntilde ascos que, seg&uacute n cuenta la leyenda, adoptaron la forma de dos amantes, satur y aran.</p><p><br/><br/>el color dorado predomina a lo largo de sus 300 metros. la playa cuenta, entre otros servicios, con un amplio aparcamiento, un bar donde sirven comidas a pie de playa, un camping en las inmediaciones y una zona nudista. <br/> <br/></p><p>&nbsp </p><p>adem&aacute s, los aficionados al deporte tienen aqu&iacute  la oportunidad de practicar numerosas actividades acu&aacute ticas como pirag&uuml ismo o windsurf.</p><p>&nbsp </p><p>quien prefiera pasear tiene dos opciones, caminar a lo largo de la orilla o seguir el paseo que comunica la playa de mutriku con la playa de la vecina ondarroa. <br/></p>', 'playas', 'gipuzkoa', 43.3218058607707, -2.41098403930664),
(47, 'playa de toña', '<p>protegida por la isla de txatxarramendi, esta tranquila y acogedora cala se asoma a la r&iacute a de mundaka. <br/> <br/>la playa de to&ntilde a est&aacute  ubicada en el municipio vizca&iacute no de sukarrieta, muy cerca del casco urbano. de aguas tranquilas, es muy recomendable para familias con ni&ntilde os. dispone de numerosos servicios  aseos, duchas, fuentes, lavapies, guardabicicletas, hondartzainas, adem&aacute s de un bar y un aparcamiento a pie de playa. <br/> <br/>en las inmediaciones, existe un parque equipado con instalaciones infantiles, mesas y bancos. en este peque&ntilde o arenal tambi&eacute n se pueden practicar diversos deportes como voleibol, vela y windsurf.</p>', 'playas', 'bizkaia', 43.3910778627597, -2.69182205200195),
(48, 'playa de zarautz', '<p>la playa de <a href=\"https://turismo.euskadi.eus/es/localidades/zarautz/aa30-12375/es/\">zarautz</a> llama especialmente la atenci&oacute n por su extensa longitud, con 2.500 metros de fina arena dorada.</p><p>&nbsp </p><p>este hermoso arenal, con sus llamativos toldos, cuenta con un <strong>animado paseo mar&iacute timo</strong> repleto de bares, cafeter&iacute as y restaurantes. la playa est&aacute  abierta al mar y es muy conocida por las olas que all&iacute  se forman, pues sirven de <strong>reclamo para surfistas</strong> que provienen de muchos lugares del mundo. de hecho, zarautz posee una de las mejores canteras de surfistas de toda europa.</p><p>&nbsp </p><p>es la <strong>playa m&aacute s extensa de la costa vasca</strong> y cuenta con multitud de rompientes. es ideal para la iniciaci&oacute n en el surf y cuenta con cinco escuelas, su club de surf es uno de los m&aacute s activos de la costa. alberga varias competiciones a lo largo del a&ntilde o, destacando el mundial wqs que se celebra en el mes de septiembre. de oeste a este destacan los picos del puerto, (el cual rompe cuando hay mar de m&aacute s de dos metros) argi&ntilde ano, verdadero epicentro de la playa y el canal, una zona m&aacute s alejada en la punta este que da sesiones de calidad.</p><p>&nbsp </p><p>el <strong>ambiente surfero de zarautz</strong> es incre&iacute ble, destacando las zonas de argi&ntilde ano y el pueblo. <br/></p>', 'playas', 'gipuzkoa', 43.28770636426836, -2.1728876364929874),
(49, 'playa de la isla de santa clara', '<p>este peque&ntilde o arenal se encuentra en el costado del embarcadero de la isla de santa clara, en el centro de la bah&iacute a de la concha. aparece s&oacute lo durante unas horas al d&iacute a, con bajamar, permaneciendo totalmente sumergido cuando la marea est&aacute  alta. se puede acceder a la playa en embarcaci&oacute n, utilizando el servicio de motoras de la isla de santa clara.</p>', 'playas', 'gipuzkoa', 43.32071050956413, -1.9996527338684018),
(50, 'playa de la zurriola', '<p>la playa de la zurriola se halla en el barrio donostiarra de gros, bajo la atenta mirada del palacio de congresos y auditorio kursaal. antiguamente, estuvo formada por grandes arenales ubicados entre la desembocadura del r&iacute o urumea y el monte ul&iacute a. en la d&eacute cada de los 90, comenzaron los trabajos de rehabilitaci&oacute n y se procedi&oacute  a la construcci&oacute n de la actual playa, de <strong>fina arena dorada y fuerte oleaje</strong>. <br/> <br/>la playa m&aacute s surfera de la capital, cuenta con olas de calidad, destacando la derecha de monpas y el centro, con derechas e izquierdas intensas. monpas puede generar buenas secciones tuberas y es la ola de m&aacute s fuerza, mientras que el centro genera principalmente izquierdas en marea baja y buenas derechas a medida que sube la marea. es una playa que recoge mucho mar y funciona en todas las mareas. en esta playa se desarrollan importantes eventos de surf como la prueba europea projunior asp que se celebra en julio. la playa cuenta con un <strong>club de surf local y cuatro escuelas de surf</strong>, por lo que es ideal para la iniciaci&oacute n. <br/></p>', 'playas', 'gipuzkoa', 43.327175706778, -1.97359085083008),
(51, 'playa del puerto (mutriku)', '<p>tal y como su propio nombre indica, esta peque&ntilde a playa urbana se sit&uacute a junto al puerto de mutriku, cerca del casco viejo de la localidad costera, declarado conjunto monumental.</p><p>&nbsp </p><p>la playa de mutriku tiene 180 metros de largo, una arena de color dorada y un fuerte oleaje, y es posible practicar diversos deportes acu&aacute ticos como pirag&uuml ismo, windsurf, buceo o el snorkel.</p><p>&nbsp </p><p><br/><br/>en las inmediaciones, hay dos piscinas naturales -una de ellas de tama&ntilde o ol&iacute mpico-, bares y restaurantes, adem&aacute s de duchas, aseos p&uacute blicos, vestuarios y una zona de juegos infantiles que se instala en &eacute poca estival. <br/></p>', 'playas', 'gipuzkoa', 43.310945042006956, -2.380482422584464),
(52, 'playas de arrietara y atxabiribil', '<p>las amplias y tranquilas playas <strong>sopela</strong>, arrietara y atxabiribil, comparten arena, aunque no hay delimitaci&oacute n entre la una y la otra. protegidas por varios acantilados, ofrecen al visitante la posibilidad de realizar numerosas actividades, entre ellas el <strong>surf</strong>. <br/> <br/></p><p>&nbsp </p><p>arrietara es el epicentro del surf en esta zona, alberga importantes citas deportivas como el mundial ibatour de bodyboard o distintos campeonatos asp. cuenta con una media docena de clubes y tres escuelas. la playa ofrece varios picos tipo <em>beach break</em>, el pasillo, una izquierda larga que rompe sobre arena y rocas que produce secciones muy verticales. sope atr&aacute s, otra izquieda larga con un <em>take off</em> agresivo que funciona s&oacute lo en marea baja. larrabasterra, un pico de izquierdas y derechas, con olas de gran calidad sobre todo en marea media y alta, la denominada el surf... todas estas olas funcionan con distintas mareas y swells. esta playa est&aacute  orientada al noroeste y recibe mucho mar. <br/> <br/></p><p>&nbsp </p><p><strong>atxabiribil</strong>, tambi&eacute n conocida como el pe&ntilde &oacute n, es una zona de olas de playa que rompen sobre rocas. funciona con todas las mareas y hay olas izquierdas y derechas, siendo un tanto mejores estas &uacute ltimas, aunque todo depende de la direcci&oacute n del swell y los fondos de arena. alberga importantes citas deportivas como la prueba projunior del circuito europeo asp. <br/>recoge todo tipo de swell y la frecuencia de olas es alta. cerca se encuentra la ola el sitio, un point break de izquierdas que en marea baja puede aguantar hasta 2 metros.</p>', 'playas', 'bizkaia', 43.389749, -2.992836),
(53, 'playas de garaio', '<p>en euskadi no es imprescindible acercarse al mar para disfrutar de magn&iacute ficas playas. a unos 15 km de vitoria-gasteiz el embalse de ullibarri-gamboa acoge varias playas interiores. <br/> <br/>es el caso de las dos playas de garaio sur y garaio norte rodeadas de zonas arboladas y de esparcimiento que forman el parque de garaio, con 116 hect&aacute reas de superficie. sus dos playas suman 2.600 metros de longitud. <br/> <br/>entre junio y agosto disponen de servicio de socorristas, duchas y plataformas de ba&ntilde o para personas con discapacidad. <br/> han sido reconocidas con bandera azul por la calidad de sus aguas, la accesibilidad, la informaci&oacute n ambiental dirigida a sus usuarios y la existencia de servicios sanitarios y de salvamento, entre otros.</p>', 'playas', 'araba/álava araba/álava', NULL, NULL),
(54, 'zierbena-puerto', '<p>situada en la costa occidental de bizkaia, esta playa artificial de tan s&oacute lo 100 metros de longitud se encuentra en el propio puerto pesquero de zierbena. <br/> <br/>esta peque&ntilde a playa se asoma en bajamar. sus aguas tranquilas son seguras para los ba&ntilde istas y sobre todo, para los m&aacute s peque&ntilde os. en verano, dispone de varios servicios, como duchas, hondartzainas, socorristas... <br/> <br/>el lugar mantiene su encanto y cierto sabor marinero, con barcos de pesca y de recreo atracados en el puerto y los t&iacute picos restaurantes y asadores en las inmediaciones que despiden un delicioso aroma de pescados cocinados a la brasa. <br/> adem&aacute s de poder tomar el sol y un agradable ba&ntilde o, la playa de zierbena ofrece al visitante la posibilidad de realizar actividades como pirag&uuml ismo y vela.</p>', 'playas', 'bizkaia', 43.350007, -3.077422);
